// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';  // Note the updated import
import App from './App'; 
import './styles/index.css'; 

const root = ReactDOM.createRoot(document.getElementById('root'));  // Create the root element
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
